import dynamic from "next/dynamic"

const Index = dynamic({
  loader: async () => {
    const rust = await import('../pkg/tic_tac_toe_bg.wasm')

    return ((props) => {
      return <div>{rust.greet()}</div>
    })
  },
})

export default Index
